import React, { Component } from 'react'


// eslint-disable-next-line import/no-anonymous-default-export
export default function (ComposedComponents) {
    class Auth extends Component {
        render() {
            return (
                <ComposedComponents{...this.props} />
            )
        }
    }
    return Auth

}
